import Navbar from "./Navbar";
import React, { useEffect, useState } from 'react';


export default function Home() {
    const [text, setText] = useState('');
  const phrase = "I'm Developer";
  useEffect(() => {
    let currentIndex = 0;
    const intervalId = setInterval(() => {
      if (currentIndex <= phrase.length) {
        setText(phrase.substring(0, currentIndex));
        currentIndex++;
      } else {
        clearInterval(intervalId);
      }
    }, 200); // Adjust typing speed here

    return () => clearInterval(intervalId);
  }, []);
    return (
           <>
           <Navbar/>

           <div className="container mt-5 d-flex  bg-dark">
            <div className="row">
                <div className="col-lg-6 text-white mt-3">
                    <h3 >Hello !<span id="h31" className="text-red"> I'm Abdelmajid S'bai</span></h3>
                    <h3>I'm <span className="text-red">Developpeure</span></h3>

                    
                </div>
                <div className="col-lg-6 mt-5">
                    <p className="text-white">Bootstrap 5 is evolving with each release to better utilize CSS variables for global theme styles, individual components, and even utilities. We provide dozens of variables for colors, font styles, and more at a :root level for use anywhere.
                     On components and utilities, CSS variables are scoped to the relevant class and can easily be modified.
                     Learn more about   CSS variables
                    </p>
                </div>

            </div>
            <h1>hello</h1>
            
            </div>        
           </>
      
      
)
}
